import React from 'react'
import './userstats.css'

function Userstats({ userData }) {
  return (
    <div className='userstats'>
      <div className='userstats__posts'></div>
        <div className='userstats__followers'></div>
        <div className='userstats__following'></div>
    </div>
  )
}

export default Userstats
